import React from 'react';

const Hobbies = () => {
    return (
        <div className="hobbies">
            <h3>Intérêts</h3>
            <ul>
                <li className="hobby">
                    <i className="fab fa-running"></i>
                    <span> Course à pieds</span>
                </li>
            </ul>
        </div>
    );
};

export default Hobbies;
